# -*- coding: utf-8 -*-if __name__ == '__main__':    ifile = open('test.in')    ofile = open('output.txt', 'w')    N = ifile.readline()        for case in range(int(N)):        words = ifile.readline().rstrip()        #words = words[:-1]                # zとqの位置が逆かも        inputs = "ynficwlbkuomxsevzpdrjgthaq "        t_letters = "abcdefghijklmnopqrstuvwxyz "                ret_words = "Case #" + str(case + 1) + ": "        for i in words:            index = inputs.find(i)            t_letter = t_letters[index]            ret_words = ret_words + t_letter                    ofile.write(ret_words + "\n")            ifile.close()    ofile.close()